class WebsiteUser:
    @log_activity
    def access_published_fabs_files(self, filters: Optional[Dict] = None) -> List[FABSSubmission]:
        session = Session()
        try:
            query = session.query(FABSSubmission).filter(FABSSubmission.is_published == True)
            if filters:
                if filters.get("start_date"):
                    query = query.filter(FABSSubmission.submission_date >= filters["start_date"])
                if filters.get("end_date"):
                    query = query.filter(FABSSubmission.submission_date <= filters["end_date"])
            files = query.all()
            logger.info(f"Accessed {len(files)} published FABS files")
            return files
        except Exception as e:
            logger.error(f"Failed to access FABS files: {e}")
            return []
        finally:
            session.close()

